ReactDOM.render(
  <React.StrictMode>
    <Router history={browserHistory}>
       <Route path={"user"} component={User}/>
       <Route path={"home"} component={Home}/>
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);

